componentProps.defaultValue:
{{!< layout/default}}
<div class="seccion-inicial">
  <img src="{{logo}}" class="logo rounded mx-auto d-block" alt="logo">
  <div class="encabezado text-center">{{ header }}</div>
  <div class="sub-encabezado text-center">{{ subHeader }}</div>
  <div class="titulo text-center">{{ title }}</div>
  <div class="numero">{{ numberTitle }}:</div>
</div>
<p class="seccion-fecha text-right">{{ dateSection }}</p>
{{ #if referencias.length }}
<div class="seccion-referencia">
  <span>Referencia: </span>
  {{ #each referencias }}
    {{ referenciaContent }}
  {{ /each }}
</div>
{{ /if }}
<hr>
{{ #if vistoSection }}
<div class="seccion-visto">
  <span>VISTO </span>{{ vistoSection }}
</div>
{{ /if }}
{{ #if considerandoSection }}
<p class="titulo-considerando">CONSIDERANDO:</p>
<div class="seccion-considerando">
  {{ considerandoSection }}
</div>
{{ /if }}
<div class="seccion-articulos">
{{ #each articulos }}
  <div class="seccion-articulo">
    {{ articuloContent }}
  </div>
{{ /each }}
</div>
